import { Star } from "@mui/icons-material";
import React from "react";
import ListItem from "../../../ui/ListItem";

const SidebarData = [
  {
    id: 1,
    name: "Kuze Kere",
    icon: <Star />,
  },
  {
    id: 2,
    name: "Kuze Kere",
    icon: <Star />,
  },
  {
    id: 2,
    name: "Kuze Kere",
    icon: <Star />,
    subItem: [{ name: "Kuze Kere", icon: <Star /> }],
  },
];

const Menu = () => {
  return SidebarData.map((item) => {
    <ListItem item={item} />;
  });
};

export default Menu;
